import { StyleSheet, Text, View, FlatList } from "react-native";
import { useNavigation } from "@react-navigation/native";
import { Button, IconButton } from "react-native-paper";
import User from "components/User";
// export default function Flex(props) {
  //navigation
  const navigation = useNavigation();
  let u = props.user.item;

  const Flex = () => {
    return (
      <View style={[styles.container, {
        // Try setting `flexDirection` to `"row"`.
        flexDirection: "row"
      }]}>
        <View style={{ flex: 1, backgroundColor: "red" }}      {...user.item.firstName} {...user.item.lastName}/>
        <View style={{ flex: 2, backgroundColor: "darkorange" }} IconButton
          icon="account-details"
          size={28}
          color="#941a1d"
          activeOpacity={0.5}
          onPress={() => navigation.navigate("Details", u)}
      />
        <View style={{ flex: 3, backgroundColor: "green" }} IconButton
          icon="square-edit-outline"
          size={28}
          color="#941a1d"
          activeOpacity={0.5}
          onPress={() => navigation.navigate("Edit", u)}
        />

        <View style={{ flex: 4, backgroundColor: "green" }} IconButton
              icon="delete"
              size={28}
              color="#941a1d"
              activeOpacity={0.5}
              onPress={() => navigation.navigate("Delete", u)} 
              />
          </View>
    );
  };

  const styles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 20,
    },
  });

  export default Flex;
